import React, {useState } from "react";
import { FaThumbsUp } from "react-icons/fa";
import { FaThumbsDown } from "react-icons/fa";
import "./App.css";
const Video = (props) => {
 const [like,setLike] =useState(0);
 const [disLike,setDisLike] =useState(0);
 const clickLike =()=>{

  setLike(like=>like+1);

 }
 const clickDisLike =()=>{
  setDisLike(disLike=>disLike+1);

 }
 const [clicked,setClicked] = useState(false);
 const deleteHandler = ()=>{
   setClicked(true);


 }



  return (
    <div className={clicked ? "visible" : "vi"}>
      <div>
        <FaThumbsUp onClick={clickLike} className="thumb" />
        <h2>{props[1].id}</h2>
        <span>{like}</span>
        <FaThumbsDown onClick={clickDisLike} className="thumb" />
        <span>{disLike}</span>
      </div>
      <button onClick={deleteHandler}>Delete</button>
    </div>
  );
};
export default Video;
